import React from 'react';
import { Button } from '@material-ui/core';
import { Link as NextLink } from 'next/Link'

export const DesktopMenu = ({ list }) => {
  return (
    <div>
      {list.map(item => (
        <NextLink >
          <Button color="inherit">{item.title}</Button>
        </NextLink>
      ))}
    </div>
  );
};
